import React, { Component } from 'react';
import './App.css';


class App extends Component {
    state = {
        people: [
          { id: 'asfasfa', name: "Dom", number:1},
          { id: 'yjdhfhd', name: "Amanda", number: 2},
          { id: 'wrqwerw', name: "Iris", number: 3}
        ],
    }
    render() {
        let people = null;

        if (this.state.showPersons){
            persons = (<P 
            persons={this.state.persons}
            clicked={this.deletePersonHandler}
            changed={this.nameChangedHandler} />
          );
        }

        return (
            <div className="App">
                {people}
            </div>
        );
    }
}

export default App;
